import React from "react";
import { CodeIcon } from "@heroicons/react/solid";
const Resume = () => {
    // const googleDocUrl = "https://drive.google.com/file/d/1mKZscvkcaYH8RQYP4ZGTVAAzQT3AXUzV/view?usp=sharing";
    return (
      <div className="flex flex-col w-full mb-20">
          <CodeIcon className="mx-auto inline-block w-10 mb-4" />
          <h1 className="sm:text-4xl text-3xl font-medium title-font mb-4 text-white">
            My Projects
          </h1>
      <div class="center-iframe">
        <iframe src="https://drive.google.com/file/d/1mKZscvkcaYH8RQYP4ZGTVAAzQT3AXUzV/preview" width="600" height="700px" allow="autoplay"></iframe>
      </div>
      </div>
    );
  };

export default Resume;
